  const total = myData.details;
  useEffect(() => {
    setDetail(total);
  }, [third]);

  console.log(total);

  return (
    <div>
      <div className="table-data">
        <table>
          <tr>
            <th>SI.NO</th>
            <th>Name</th>
            <th>Gender</th>
            <th>DoB</th>
            <th>Email</th>
            <th>Mobile</th>
            <th>location</th>
          </tr>

          {detail.map((totals) => (
            <tr key={totals.id}>
